import "./App.css";
import Video from "./pages/Video";

function App() {
  return (
    <div className="App">
      <div className="app_videos">
        <Video 
          likes={100} 
          messages={200} 
          shares={300}
          name=""
          description="Gato goleiro"
          musica="Música épica"
          />
        <Video likes={111} messages={222} shares={333} />
        <Video />
        <Video />
        <Video />
      </div>
    </div>
  );
}

export default App;
